import { Nav, NavItem, NavLink } from 'reactstrap';

const Header = (props) => (
   <Nav style={{width: "100%"}}>
      <NavItem>
         <img src={props.navlogo} className="img-fluid" style={{width: "20%", padding: "5%"}}/>
      </NavItem>
      {
         props.navitems.map(navitem => (
               <NavItem key={navitem.key}>
                  <NavLink href={navitem.link}>{navitem.label}</NavLink>
               </NavItem>
            )
         )
      }
   </Nav>
)

export default Header
